# s = ""
s ="geeksforgeeks"

def getcount(s):
      chars = {}
      for c in s:
        if chars.get(c):
          chars[c] += 1
        else:
          chars[c] = 1
      for c in s:
        if chars[c] == 1:
          return c
      return -1
       

    
print(getcount(s))
# time complexity - O(n)
# aux = O(N)
           